export const OpeningAnimation = () => {
  const items = [First, Second];

  //   文字が順番に出てくる
  const [springs] = useSprings(items.length, () => ({
    from: { opacity: 0, translateY: 0 },
    to: [
      { opacity: 1, config: { duration: 1000 } },
      { opacity: 0, config: { duration: 1000 } },
    ],
  }));

  //   開幕！
  const fadeParent = useSpring({
    from: { height: '100vh' },
    to: { height: '0' },
    config: { duration: 1000 },
    delay: 2000,
  });

  return (
    <animated.div
      className={
        'fixed left-0 top-0 z-50 flex h-screen w-full flex-col items-center justify-center gap-2 bg-white'
      }
      style={{ height: fadeParent.height }}
    >
      {items.map((Item, index) => (
        <Item key={index} opacity={springs[index].opacity} />
      ))}
    </animated.div>
  );
};
